Here are some guidelines to help you decide when to use `cloneElement`:

1. When you need to add or modify properties of a child element:

If you have a component that renders children and you need to add or modify properties of those children, you can use `cloneElement` to create a new element with the updated properties.

For example, suppose you have a `List` component that renders a list of items. You want to add a `selected` property to the item that is currently selected. You can use `cloneElement` to create a new element with the `selected` property:
