function List({ children, selectedItem }) {
  return (
    <ul>
      {React.Children.map(children, (child) => {
        if (child.type === Item) {
          return cloneElement(child, { selected: child.props.id === selectedItem });
        }
        return child;
      })}
    </ul>
  );
}

function Item({ id, children }) {
  return <li id={id}>{children}</li>;
}

// Usage
