## Introduction

In this article, we will learn how to write a CSV downloader using web workers in the Ember Octane framework.

## Prerequisites

To follow along with this article, you should have a basic understanding of the following:

1. Ember Octane
2. Web Workers

## What is a CSV downloader?

CSV downloader is a feature that allows users to download data in CSV format.

## Why use web workers?

Web workers allow us to run JavaScript code in the background without blocking the main thread. This is useful for long-running tasks such as generating a CSV file. By using web workers, we can ensure that the user interface remains responsive while the CSV file is being generated.

## Creating a new Ember Octane project

To create a new Ember Octane project, run the following command in your terminal:
```lua
ember new csv-downloader
```
Once the project has been created, navigate to the project directory:
```bash
cd csv-downloader
```
## Creating a new component

Next, let's create a new component for our CSV downloader. Run the following command in your terminal:
```lua
ember g component csv-downloader
```
This will create a new component at `app/components/csv-downloader/component.js`. Open this file and replace its contents with the following:
```js
import Component from '@glimmer/component';
import { action } from '@ember/object';

export default class CsvDownloaderComponent extends Component {
  @action
  download() {
    const worker = new Worker('/workers/csv-worker.js');

    worker.postMessage({ data: this.args.data });

    worker.onmessage = (event) => {
      const blob = new Blob([event.data], { type: 'text/csv' });
      const url = URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = 'data.csv';
      a.click();
    };
  }
}
```
In this code, we create a new web worker and post a message to it with the data to be downloaded. We then listen for a message from the worker containing the generated CSV data, create a Blob object from it, and initiate a download.

## Creating a new web worker

Next, let's create a new web worker for our CSV downloader. Create a new file at `public/workers/csv-worker.js` and replace its contents with the following:
```js
self.addEventListener('message', (event) => {
  const data = event.data;

  const csv = data.map((row) => row.join(',')).join('\n');

  self.postMessage(csv);
});
```
