 }
 case CS\_RELEASE: {
 if (queue.info[0].id == from) {
 pop();
 }
 fprintf(EventsLog, "process %i CS\_RELEASE from %i\n", id, from);
 fflush(EventsLog);
 break;
 }
 case DONE: {
 set\_done(from);
 fprintf(EventsLog, "process %i DONE from %i", id, from);
 fflush(EventsLog);
 }
 default: {
 break;
 }
 }
}

int release\_cs\_clean(const void \*self) {
 pop();
 Message release = createMessage(MESSAGE\_MAGIC, 0,0,0,CS\_RELEASE);
 for (int i = 1; i <= process\_count; i++) {
 queue.replies[i] = id != i ? 0 : 1;
 }
 send\_multicast(&id, &release);
 return 0;
}

int exit\_mutex\_clean() {
 for (int i = 1; i <= process\_count; i++){
 if (queue.done[i] == 0)
 return 0;
 }
 return 1;
}

int entered\_mutex\_clean() {
 if (queue.info[0].id == id) {
 for(int i = 1; i<=process\_count; i++) {
 if (queue.replies[i] == 0){
 return 0;
 }
 }
 } else {
 return 0;
 }
 return 1;
}

int set\_done\_clean(int i) {
 queue.done[i] = 1;
}

int set\_reply\_clean(int i) {
 queue.replies[i] = 1;
}

